import React from "react";
import ReactDOM from "react-dom/client";
import { GetModelList } from "./GetModelList.js";

export class Application extends React.Component {
  render () {
    return (
      <div>
				<form action = "" style = {{margin: "auto", width: "max-content"}}>
					<div>
						<label for = "UploadSample"> Upload Sample: </label>
						<input type = "file" id = "UploadSample" name = "UploadSample"/>
					</div>
					<SelectModel />
					<div>
						<input type = "submit" value = "Submit (What Verb is Appropriate?)" />
					</div>
				</form>
				<h1 style = {{textAlign: "center"}} > I am a wrapper for whatever app goes here </h1>
        <div style = {{margin: "auto", width: "max-content"}}>
          ToDo:
					<p> <b> Get list of models from Python </b> </p>
          <p> Model selector drop-down with instructions </p>
          <p> Tie to server command-line </p>
          <p> Handle server output </p>
        </div>
      </div>
    );
  }
}

class SelectModel extends React.Component {
	/*	I want to be able to update this thing if it ever changes.	*/
	/*	Where should I get this prop? Maybe it's not important right now.	*/
	render () {
		return (<>
			<label for = "SelectModel"> Select Model: </label>
			<select id = "SelectModel">
			</select>
			<ul>
				{["1"].map (num => (
					<option value = {num}>
						{num}
					</option>
				))}
			</ul>
		</>);
	}
}
